Yes, you can use JavaScript's regular expressions to find the first set of numbers in a string. Here's a simple example of how you can do this:

```javascript
const str = "Here are some numbers: 123 and some more numbers: 456";
const match = str.match(/\d+/);

if (match) {
  console.log(match[0]); // Output: 123
} else {
  console.log("No numbers found");
}
```

Explanation:
- `\d+` is a regular expression pattern where `\d` matches any digit (equivalent to `[0-9]`) and `+` means one or more of the preceding element.
- `str.match(/\d+/)` returns an array of matches, or `null` if no match is found.
- `match[0]` contains the first match found in the string.
